description:
created on a lark one evening after considering certain qualities that could be achieved with certain brushes . the result was satisfying but did not feel that there was any particular concept grounding it . friends were consulted for a title . these are listed as follows in no particular order using twitter handles as reference to the persons:

@obunft - that shuld be the way.
@camila_gonzatto - Psychedelic blueberries
@joeychips - Party under the Microscope
@lenara - Amoebius xtravagant
@ABDLLHSYLART - mitosis?
@moltkecorp - evolving together
@nathansonic - Twunt
@PogTheArtist - Blobgasm
@buddymunro - Could Have Bean
@adrere - Bubble me!
@GhostAgent_OG - The corpuscularity of being
@Labelsonhumans - Fkn Wonderful
@ryptorn - Under Microscope

loved and appreciated all of the responses and concluded that the best way was to 'immortalize' it by writing down the responses and gifting the piece to each person who participated.

in gratitude
